<!DOCTYPE html>
<html lang="en">
<head>
    <meta charset="UTF-8">
  <meta name="viewport" content="width=device-width, initial-scale=1.0">
  <title>Loadingâ€¦</title>
  <link rel="canonical" href="/messages">
        <script>
        if (window.zaraz && typeof window.zaraz.track === "function") {
            window.zaraz.track("page_view", { path: window.location.pathname, title: document.title });
        }
    </script></head>
<body>
  <noscript>
    <p>This page requires JavaScript. Open <a href="messages">messages.html</a> instead.</p>
  </noscript>
  <script>
    fetch('messages.html', { cache: 'no-store' })
      .then((response) => response.text())
      .then((html) => {
        document.open();
        document.write(html);
        document.close();
      })
      .catch(() => {
        window.location.href = 'messages.html';
      });
  </script>
  <script src="vendor-dashboard/vendor-dashboard.js" defer></script>
</body>
</html>
